- input: "TEXT\x1CC00477828\x1CX0\x1C\x1CF3A\x1CDear Mr. Holly,    This letter is
    in response to the Federal Election Commission?s Request for Additional Information
    (Identification Number: C00477828).    The Hansen Clarke For Congress committee
    maintained records that distinguished between primary election and general election
    contributions received for the 2012 election cycle.    After the 2012 primary
    election, our committee notified contributors by letter that their contributions
    to the general election would be refunded if the contributor did not reattribute
    or redesignate the excessive contribution within 60 days.    The Hansen Clarke
    For Congress committee will continue to refund these excessive contributions as
    the funds become available through fundraising.    Sincerely,    Choi Palms-Cohen
    \ Treasurer\n"
